class Home_bayar extends React.Component{
    render(){
        return(
            <div class="bayar">
                    <Pembayaran/>
            </div>
        )
    }
    }
    
    class Pembayaran extends React.Component{
    render(){
        return(
            <center>
            <div class="form">
                <div class="input_text">
                    <span>Nama</span><br/>
                    <input type="text"/>
                </div>
                <div class="input_text">
                    <span>E-mail</span><br/>
                    <input type="text"/>
                </div>
                <div class="input_text">
                    <span>Jumlah Tiket</span><br/>
                    <input type="number"/>
                </div>
                <div class="select">
                    <span>Pembayaran</span><br/>
                    <select class="type_bayar">
                        <option value="">BCA</option>
                        <option value="">BRI</option>
                        <option value="">BNI</option>
                        <option value="">MANDIRI</option>
                        <option value="">BANK JATIM</option>
                    </select>
                </div>
                <div class="input_button">
                <div class="cancel">
                   <a href="/index"> <button class="b_1">Cancel</button></a></div>
                  <Nav/>
                </div>
            </div></center>
        )
    }
    }
    class Nav extends React.Component {
            state = {
                click: false
            }
    
            render(){
                return(
                    <div class="pesan">
                        <a  onClick={() => {this.setState({ click: !this.state.click })}}><button class="b_2">Pesan</button></a>
                        {this.state.click ? <Isi_nav /> : null}
                    </div>
                );
            }
        }
    
        class Isi_nav extends React.Component{
        render(){
                return(
                    <div class="kotak_himbauan">
                        <div class="isi_himbauan">
                        <h2>Pesanan akan segera diproses</h2><br/><h3>virtual tiket akan dikirimkan ke E-mail anda setelah pembayaran dikonfirmasi</h3>
                        <br/> <div class="lanjut"><a href="/index"> lanjutkan</a></div> 
                        </div>
                    </div>
                );
            }
    
    }
    export default Home_bayar;
